def skew(genome):
  s=0
  min=0
  m=set()
  for i in range(0,len(genome)):
    if (genome[i]=="G"):
      s+=1
    if (genome[i]=="C"):
      s-=1
      if (s<min):
        min=s
        m.clear()
        m.add(i+1)
      if(s==min):
        m.add(i+1)
  return m

skew("")